```rust
pub struct Item {
    weight: i32,
    value: i32,
}

pub fn knapsack(items: &Vec<Item>, capacity: i32) -> i32 {
    let mut dp = vec![vec![0; (capacity + 1) as usize]; items.len() + 1];

    for (i, item) in items.iter().enumerate() {
        for w in 0..=(capacity + 1) as usize {
            if item.weight as usize > w {
                dp[i + 1][w] = dp[i][w];
            } else {
                dp[i + 1][w] = std::cmp::max(dp[i][w], dp[i][(w - item.weight as usize) as usize] + item.value);
            }
        }
    }
    dp[items.len()][capacity as usize]
